import { get } from '../../services/http';

import { useEffect } from 'react';

function Vouchers(props) {

    useEffect(() => {
        async function getData() {
            const data = await get(`/voucher`);

            console.log( data )
        }

        getData();
    }, []);

    return (
        <h1>teste</h1>
    );

}

export default Vouchers;
